window.bookSummaryJSON = "<p><b>First contact gone wrong....</b></p> <p>It was every starship captain’s nightmare, and for Travis Miller, it was his own personal hell.</p> <p>He’d done everything by the book, but when the Tahni had attacked him and his crew, there was no choice but to return fire and destroy the first alien vessel humans had ever encountered.</p> <p>Excoriated in the press, his career in shambles, Travis is exiled to a long patrol of the outer colony worlds. Forgotten, except as a bad example...until the Tahni prove him right by declaring war on the human commonwealth.</p> <p>Now, Travis Miller is the tip of the spear. Humanity’s best hope for turning back an overwhelming assault on human space. Because to the Tahni, humans are infidels and this is a holy war....</p> <p><b>Don’t miss the next explosive series from the number-one Amazon best-selling author of </b><b><i>Contact Front</i></b><b>, Rick Partlow. This is military sci-fi the way it’s meant to be. It’s perfect for fans of Jay Allan, Jasper T. Scott, and Scott Bartlett.</b></p>"; 
